    	stxa    %l6, [%g0 + ASI_SPU_CWQ_HEAD] %asi
    	ldxa    [%g0 + ASI_SPU_CWQ_HEAD] %asi, %l1
    	cmp 	%l1, %l2
    	bne,pn 	%xcc,    _t1_fail
